(52, '2022-10-17', 266, 'Masih ada Tim PT1 yg tidak langsung melakukan Update valins setelah melakukan PSB, sehingga mempengaruhi&nbsp; Valins Service masih dibawah Ach &lt; 95%.&nbsp;', 'close', '328', 26),
(53, '2022-10-17', 266, 'Teknisi Sektor apabila melakukan perubahan data di ODP harus dilakukan valins kembali dan Melaporkan ke tim daman pada HI Close Tiket.<div><br></div>&nbsp;', 'open', '328', 26),
