(58, '2022-10-17', 698, 'Produk Knowledge dan Brand awarness terhadap paket tersebut relatif sangat rendah. Terbukti setelah kami sampling dari 10 pelanggan hanya 2 yang tau basic dari paket tersebut', 'open', '328', 53),
(59, '2022-10-17', 238, 'Peningkatan sales bulan agustus dikarenakan adanya paket odp HH&nbsp; 275ribu yang di massive kan pada lokasi yang head to head dengan kompetitor', 'open', '328', 52),
(60, '2022-10-17', 238, 'New sales indihome terkoreksi karena proses peralihan order base ke resource base', 'open', '328', 52),
