(68, '2022-10-31', 236, '<p>Berikut adalah gambar untuk mengilustrasikan jarak tempuh Teknisi Provisioning untuk mencapai suatu daerah. Basecamp Teknisi PT1 berada di STO Parigi. existing solution dari TA sementara ini : meminta bantuan teknisi wilsus untuk membantu melakukan penarikan. tetapi terkadang team wilsus pun beralasan sibuk dengan pekerjaan lain sehingga WO terpending sangat lama. hal ini membuat sales MIP/Sobi menjadi enggan untuk berjualan di tempat yang jauh tersebut karena merasa tidak nyaman di kejar kejar oleh pelanggan yang di registrasikan.<img src=\"data:image/jpeg;base64,', 'open', '25', 52);
