(70, '2022-10-31', 896, 'Rutin melakukan daily activity', 'open', '328', 223),
(71, '2022-10-31', 896, 'Pengawalan End to End daily monitoring bersama tim CCAN untuk follow up order', 'open', '328', 223),
(72, '2022-11-01', 894, 'Penurunan penjualan modem orbit salah satunya di sebabkan oleh close produksi nya orbit star 2 (price market sesuai dengan witel sulteng)', 'open', '328', 222),
(73, '2022-11-01', 894, 'Penjualan modem orbit tidak maksimal karena jumlah sales force yang jualan orbit berkurang dan AO tersisa pun hanya ada 4 orang', 'open', '328', 222),
(74, '2022-11-02', 236, 'Gaji yang sampat tertunda 2 bulan menurunkan semangat tim PSB tawaeli terlihat dari sempat hilangnya PS mereka di minggu awal oktober', 'open', '25', 52),
(75, '2022-11-04', 26, 'hal ini dikarenakan teknisi Proivisioning yang bekerja di wilayah tolay-sausu adalah teknisi dari Parigi yang jarak tempuh dari parigi adalah 35-50km. saat terjadi gangguan garansi, teknisi dari parigi lambat untuk menuju ke tolay', 'open', '22', 19),
(76, '2022-11-06', 25, 'PLN tidak optimal di lokasi bahodopi menyebabkan supply listrik ke olt mini sering gangguan', 'open', '26', 19),
(77, '2022-11-07', 179, 'Alker Salker teknisi belum sesuai kontrak kerja, sehingga masih banyak pelanggaran&nbsp; SOP psb di RO Bungku', 'open', '26', 28),
(78, '2022-11-07', 179, 'Tidak adanya tenaga maintenance di RO bungku sehingga tangible odp jarang dilakukan', 'open', '26', 28),
(79, '2022-11-07', 179, 'Banyak aktifitas pembangunan alpro yang melintasi tiang existing hanya asal menarik kabel sehingga dropcore banyak yang putus', 'open', '26', 28),
(80, '2022-11-07', 764, 'Tidak ada database yang berisi alamat detil pelanggan baik dilaporan up maupun dilaporan gangguan', 'open', '26', 2),
(81, '2022-11-07', 794, 'Tidak ada pengawalan bilper untuk pelanggan digital channel&nbsp;', 'open', '26', 6),
(82, '2022-11-07', 180, 'Jarak antara gudang STO palu - Parigi Tolay 80-100 km. dan melintasi pegunungan kebun kopi. pengeluaran material gamas harus menggunakan tiket gamas. sehingga penanganan membutuhkan waktu lama, karena stock tidak dekat', 'open', '25', 28),
(83, '2022-11-08', 236, '<p>setelah di lakukan wawancara, alasan penggunaan pigtail adalah karena SPLICER yang disediakan mitra sebelumnya tidak memiliki dudukan SOC (ANP) sedangkan mereka dikejar PS. setelah mereka pindah mitra (ASS) pun, ternyata WH mengirim SOC yang sangat sedikit, yakni 20 ONT 20 SOC. pemasangan 1 Lis saja membutuhkan setidaknya 2 SOC, itupun kalau penyambungan langsung berhasil. kalau gagal, berarti membutuhkan lebih dari 2 SOC untuk 1 PS.&nbsp;<br>setelah dilakukan wawancara lebih jauh, ternyata mencuatlah beberapa permasalahan :&nbsp;</p><p>1. SOC kurang, sehingga gunakan pigtail<br>2. Kontrak PT1 mitra tidak ada<br>3. Keterlambatan Gaji<br>4. BPJS kesehatan bayar sendiri, tidak di bayarkan mitra<br>5. gaji yang di terima berbeda dengan yang pernah di sebutkan sebelumnya. tidak bisa menuntut karena tidak pegang kontrak</p><p><br></p>', 'open', '25', 52);
